  /**
   * Resumes scanning until the next regular expression is matched,
   * the end of input is encountered or an I/O-Error occurs.
   *
   * @return      the next token
   * @exception   java.io.IOException  if any I/O-Error occurs
   */
  public IElementType advance() throws java.io.IOException {
    int zzInput;
    int zzAction;

    // cached fields:
    int zzCurrentPosL;
    int zzMarkedPosL;
    int zzEndReadL = zzEndRead;
    CharSequence zzBufferL = zzBuffer;

    int [] zzTransL = ZZ_TRANS;
    int [] zzRowMapL = ZZ_ROWMAP;
    int [] zzAttrL = ZZ_ATTRIBUTE;

    while (true) {
      zzMarkedPosL = zzMarkedPos;

      zzAction = -1;

      zzCurrentPosL = zzCurrentPos = zzStartRead = zzMarkedPosL;

      zzState = ZZ_LEXSTATE[zzLexicalState];

      // set up zzAction for empty match case:
      int zzAttributes = zzAttrL[zzState];
      if ( (zzAttributes & 1) == 1 ) {
        zzAction = zzState;
      }


      zzForAction: {
        while (true) {

          if (zzCurrentPosL < zzEndReadL) {
            zzInput = Character.codePointAt(zzBufferL, zzCurrentPosL/*, zzEndReadL*/);
            zzCurrentPosL += Character.charCount(zzInput);
          }
          else if (zzAtEOF) {
            zzInput = YYEOF;
            break zzForAction;
          }
          else {
            // store back cached positions
            zzCurrentPos  = zzCurrentPosL;
            zzMarkedPos   = zzMarkedPosL;
            boolean eof = zzRefill();
            // get translated positions and possibly new buffer
            zzCurrentPosL  = zzCurrentPos;
            zzMarkedPosL   = zzMarkedPos;
            zzBufferL      = zzBuffer;
            zzEndReadL     = zzEndRead;
            if (eof) {
              zzInput = YYEOF;
              break zzForAction;
            }
            else {
              zzInput = Character.codePointAt(zzBufferL, zzCurrentPosL/*, zzEndReadL*/);
              zzCurrentPosL += Character.charCount(zzInput);
            }
          }
          int zzNext = zzTransL[ zzRowMapL[zzState] + ZZ_CMAP(zzInput) ];
          if (zzNext == -1) break zzForAction;
          zzState = zzNext;

          zzAttributes = zzAttrL[zzState];
          if ( (zzAttributes & 1) == 1 ) {
            zzAction = zzState;
            zzMarkedPosL = zzCurrentPosL;
            if ( (zzAttributes & 8) == 8 ) break zzForAction;
          }

        }
      }

      // store back cached position
      zzMarkedPos = zzMarkedPosL;

      if (zzInput == YYEOF && zzStartRead == zzCurrentPos) {
        zzAtEOF = true;
        return null;
      }
      else {
        switch (zzAction < 0 ? zzAction : ZZ_ACTION[zzAction]) {
          case 1: 
            { throw new RuntimeException("Unexpected value '" + yytext() + "' at state " + yystate());
            } 
            // fall through
          case 48: break;
          case 2: 
            { return WHITE_SPACE;
            } 
            // fall through
          case 49: break;
          case 3: 
            { return EOL;
            } 
            // fall through
          case 50: break;
          case 4: 
            { yybegin(S_MESSAGES); return EOL;
            } 
            // fall through
          case 51: break;
          case 5: 
            { yybegin(S_LANG_NAMED); return LANG_NAME;
            } 
            // fall through
          case 52: break;
          case 6: 
            { return LANG_LOCAL;
            } 
            // fall through
          case 53: break;
          case 7: 
            { return INDENT;
            } 
            // fall through
          case 54: break;
          case 8: 
            { yybegin(S_TREE_MESSAGE); return MESSAGE_ID;
            } 
            // fall through
          case 55: break;
          case 9: 
            { return LITERAL;
            } 
            // fall through
          case 56: break;
          case 10: 
            { yybegin(S_TREE_SOL); return EOL;
            } 
            // fall through
          case 57: break;
          case 11: 
            { return CLOSE_BRACE;
            } 
            // fall through
          case 58: break;
          case 12: 
            { return ARG_NAME;
            } 
            // fall through
          case 59: break;
          case 13: 
            { yybegin(S_TREE_MESSAGE); return CLOSE_BRACE;
            } 
            // fall through
          case 60: break;
          case 14: 
            { yybegin(S_TREE_REF_MESSAGE_ARGS); return MESSAGE_ID;
            } 
            // fall through
          case 61: break;
          case 15: 
            { yybegin(S_TREE_REF_MESSAGE_START_ARG); return OPEN_PAREN;
            } 
            // fall through
          case 62: break;
          case 16: 
            { yybegin(S_TREE_REF_MESSAGE_EQUAL_ARG); return ARG_NAME;
            } 
            // fall through
          case 63: break;
          case 17: 
            { yybegin(S_TREE_REF_MESSAGE_ARGS); return CLOSE_PAREN;
            } 
            // fall through
          case 64: break;
          case 18: 
            { yybegin(S_TREE_REF_MESSAGE_END_ARG); return ARG_EQUALS;
            } 
            // fall through
          case 65: break;
          case 19: 
            { yybegin(S_TREE_REF_MESSAGE_NEXT_ARG); return ARG_NAME;
            } 
            // fall through
          case 66: break;
          case 20: 
            { yybegin(S_TREE_REF_MESSAGE_NEXT_ARG); return NUMBER_LITERAL;
            } 
            // fall through
          case 67: break;
          case 21: 
            { yybegin(S_TREE_REF_MESSAGE_END_ARG_STRING_LITERAL); return OPEN_QUOTE;
            } 
            // fall through
          case 68: break;
          case 22: 
            { yybegin(S_TREE_REF_MESSAGE_NEXT_ARG); return CLOSE_QUOTE;
            } 
            // fall through
          case 69: break;
          case 23: 
            { yybegin(S_TREE_REF_MESSAGE_START_ARG); return ARGS_SEPARATOR;
            } 
            // fall through
          case 70: break;
          case 24: 
            { yybegin(S_TREE_REF_SPAN_SPACE); return SPAN_NAME;
            } 
            // fall through
          case 71: break;
          case 25: 
            { yybegin(S_TREE_MESSAGE); return WHITE_SPACE;
            } 
            // fall through
          case 72: break;
          case 26: 
            { yybegin(S_TREE_ARG_NAMED); return ARG_NAME;
            } 
            // fall through
          case 73: break;
          case 27: 
            { yybegin(S_TREE_ARG_UNTYPED); return WHITE_SPACE;
            } 
            // fall through
          case 74: break;
          case 28: 
            { yybegin(S_TREE_ARG_TYPED); return ARG_TYPE;
            } 
            // fall through
          case 75: break;
          case 29: 
            { yybegin(S_TREE_ARG_DEFAULT); return ARG_EQUALS;
            } 
            // fall through
          case 76: break;
          case 30: 
            { yybegin(S_TREE_SOL); return ARG_NAME;
            } 
            // fall through
          case 77: break;
          case 31: 
            { yybegin(S_TREE_SOL); return NUMBER_LITERAL;
            } 
            // fall through
          case 78: break;
          case 32: 
            { yybegin(S_TREE_ARG_DEFAULT_STRING_LITERAL); return OPEN_QUOTE;
            } 
            // fall through
          case 79: break;
          case 33: 
            { yybegin(S_TREE_SOL); return CLOSE_QUOTE;
            } 
            // fall through
          case 80: break;
          case 34: 
            { return DOC_VALUE;
            } 
            // fall through
          case 81: break;
          case 35: 
            { return VERSION_VALUE;
            } 
            // fall through
          case 82: break;
          case 36: 
            { return COMMENT;
            } 
            // fall through
          case 83: break;
          case 37: 
            { return ESCAPE;
            } 
            // fall through
          case 84: break;
          case 38: 
            { yybegin(S_TREE_REF_SPAN_START); return PERCENT_OPEN;
            } 
            // fall through
          case 85: break;
          case 39: 
            { yybegin(S_TREE_REF_ARG); return DOLLAR_OPEN;
            } 
            // fall through
          case 86: break;
          case 40: 
            { yybegin(S_TREE_REF_MESSAGE); return HASH_OPEN;
            } 
            // fall through
          case 87: break;
          case 41: 
            { return BASE_KEYWORD;
            } 
            // fall through
          case 88: break;
          case 42: 
            { yybegin(S_LANG_UNNAMED); return LANG_KEYWORD;
            } 
            // fall through
          case 89: break;
          case 43: 
            { yybegin(S_TREE_ARG); return ARG_KEYWORD;
            } 
            // fall through
          case 90: break;
          case 44: 
            { yybegin(S_TREE_DOC); return DOC_KEYWORD;
            } 
            // fall through
          case 91: break;
          case 45: 
            { yybegin(S_TREE_VERSION); return SINCE_KEYWORD;
            } 
            // fall through
          case 92: break;
          case 46: 
            { yybegin(S_TREE_SOL); return MESSAGES_KEYWORD;
            } 
            // fall through
          case 93: break;
          case 47: 
            { yybegin(S_TREE_VERSION); return UPDATED_KEYWORD;
            } 
            // fall through
          case 94: break;
          default:
            zzScanError(ZZ_NO_MATCH);
          }
      }
    }
  }


